  <section>
    <Container>
      <Row>
       <SearchBar />
      </Row>
    </Container>
  </section>
  <section>
    <Container>
      <Row>
       {
        tourData ?.map(tour => <Col lg ='3' key ={tour.id} >
          {""}
          <TourCard tour ={tour} /></Col>)
       }
      </Row>
    </Container>
  </section>
  
  
  
  </>
};

